import React from 'react'
import './App.css';

const RestaurantList = ({onClick, label, style}) => {
  return (
    <div 
      className="block-button"
      style={style}
      onClick={onClick}>
      <label>{label}</label>
    </div>
  );
}

export default RestaurantList;
